import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import EnqCard from '../components/EnqCard';

function Enquetes() {
  const [enquetes, setEnquetes] = useState([])

  useEffect(() => {
    axios.get('http://localhost:3001/enquetes')
      .then(res => {
        // console.log(res);
        setEnquetes(res.data)
      })
      .catch(err => {
        console.log(err);
      })
  }, [])

  return (
    <div>
      <h1 className='Title'>Login</h1>
      <Link className='Title' to='/createEnquete'><h2>Registrar</h2></Link>
      {/* <EnqCard data={enquetes} /> */}
    </div>
  );
}

export default Enquetes;
